import React from 'react'
import styled from 'styled-components'

import logoImg from '../assets/logo.png'

// const Wrapper = styled.div`
//   width: 20%;
// `
const HeaderLogo = styled.img`
  position: relative;
  padding: 10px;
  width: 70%;
`

const Logo = () => {
  return (
    <a href="#" >
      <HeaderLogo src={logoImg} alt="petspotter-logo" />
    </a>
    // </Wrapper>
  )
}

export default Logo
